import './App.css'
import 'semantic-ui-css/semantic.min.css'
import { BrowserRouter as Router } from 'react-router-dom'


import Body from './layouts/body/Body'
import Header from './layouts/header/Header';

function App() {
  return (

    <div className="App">
      <Router>
        <Header/>
        <Body />
      </Router>
    </div>
  );
}

export default App;
